import React from 'react';
import ListContent from './content_json.js';


class PersonMessage extends React.Component{
  render(){
    return(
      <div class="personmessage container border">
        <div class="contacth">
          <h3 class="mt-5 font-weight-bolder text-center">Looking for help?</h3>
          <p class="col-12 pt-2 text-center">
            Send us a message and we will get back to you.
          </p>
        </div>
      <form class="formcon" action="/action_page.php">
        <div class="contact form-group mt-5 row">
        {ListContent.map((item,index)=>{
          return(
            <div key={index}>
              <label for={item.for} class="col-2 col-form-label font-weight-bold">{item.value}</label>
              <div class="col-5">
                <input type={item.type} class="form-control" id={item.id} name={item.name}/>
              </div>
            </div>
            )
          })}
        </div>
      </form>
      </div>
    )
  }
}
export default PersonMessage
